import React from "react";
import ReactDOM from "react-dom";

function ping() {
    fetch('/api')
        .then(response => {return <div>response.text()</div>});
}

ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        ping()
    </div>,
    document.getElementById('root')
);
